import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";
import "./acciones";

function App() {
  const [nombre, setNombre] = useState("");
  const [edad, setEdad] = useState(0);
  const [pais, setPais] = useState("");
  const [cargo, setCargo] = useState("");
  const [anios, setAnios] = useState("");

  const [listaEmpleados, setListaEmpleados] = useState([]);

  const Guardar = () => {
    axios
      .post("/api/v1/empleados/create", {
        nombre,
        edad,
        pais,
        cargo,
        anios,
      })
      .then((response) => {
        console.log(response);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  const Cargar = () => {
    axios
      .get("/api/v1/empleados/findAll")
      .then((response) => {
        console.log(response);
        setListaEmpleados(response.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  Cargar();

  return (
    <div class="container">
      <div class="row justify-content-around">
        <div class="col-12 col-sm-4">
          <h1 class="text-center">Titulo</h1>
          <form class="form-horizontal" role="form" id="formulario">
            <div class="form-floating mb-3">
              <input
                type="text"
                class="form-control"
                id=""
                placeholder="info"
                onChange={(event) => {
                  setNombre(event.target.value);
                }}
              />
              <label for="floatingInput">Nombre</label>
            </div>
            <div class="form-floating mb-3">
              <input
                type="text"
                class="form-control"
                id=""
                placeholder="info"
                onChange={(event) => {
                  setEdad(event.target.value);
                }}
              />
              <label for="floatingInput">Edad</label>
            </div>
            <div class="form-floating mb-3">
              <input
                type="text"
                class="form-control"
                id=""
                placeholder="info"
                onChange={(event) => {
                  setPais(event.target.value);
                }}
              />
              <label for="floatingInput">Pais</label>
            </div>
            <div class="form-floating mb-3">
              <input
                type="text"
                class="form-control"
                id=""
                placeholder="info"
                onChange={(event) => {
                  setCargo(event.target.value);
                }}
              />
              <label for="floatingInput">Cargo</label>
            </div>
            <div class="form-floating mb-3">
              <input
                type="text"
                class="form-control"
                id=""
                placeholder="info"
                onChange={(event) => {
                  setAnios(event.target.value);
                }}
              />
              <label for="floatingInput">Años</label>
            </div>
            <div class="form-floating mb-3">
              <button
                type="button"
                id="boton"
                class="btn btn-primary"
                onClick={Guardar}
              >
                Guardar
              </button>
              <button type="reset" class="btn btn-danger">
                Limpiar
              </button>
            </div>
          </form>
        </div>
        <div class="col-12 col-sm-4">
          <button
            type="button"
            id="boton"
            class="btn btn-primary"
            onClick={Cargar}
          >
            Actualizar información
          </button>
          <h1 class="text-center">Empleados registrados</h1>
          <table class="table table-dark table-striped">
            <thead>
              <tr>
                <th scope="col">#</th>
                <th scope="col">nombre</th>
                <th scope="col">edad</th>
                <th scope="col">pais</th>
                <th scope="col">cargo</th>
                <th scope="col">anios</th>
              </tr>
            </thead>
            <tbody>
              {listaEmpleados.map((val, key) => {
                return;
                <tr>
                  <th scope="row">{val.id}</th>
                  <td>{val.nombre}</td>
                  <td>{val.edad}</td>
                  <td>{val.pais}</td>
                  <td>{val.cargo}</td>
                  <td>{val.anios}</td>
                </tr>;
              })}
            </tbody>
          </table>
        </div>
      </div>

      <h4>
        <h1>Obtener todos los empleados</h1>
        <span class="badge bg-secondary">GET</span>{" "}
        <labe>/api/v1/findAll/</labe>
      </h4>
      <h4>
        <h1>Crear empleado</h1>
        <span class="badge bg-secondary">POST</span> <labe>/api/v1/create/</labe>
      </h4>
      <h4>
        <h1>Actualizar empleado</h1>
        <span class="badge bg-secondary">UPDATE</span> <labe>/api/v1/update/</labe>
      </h4>
      <h4>
        <h1>Eliminar empleado</h1>
        <span class="badge bg-secondary">DELETE</span> <labe>/api/v1/delete/</labe>
      </h4>
    </div>
  );
}

export default App;
